  return (
    <div className="day-page">
      <h1>Day Page</h1>
      {typeof backendData.users === "undefined" ? (
        <p>Loading...</p>
      ) : (
        backendData.users.map((user, i) => <p key={i}>{user}</p>)
      )}
      <Link to="/">
        <button>Back</button>
      </Link>
    </div>
  );
}
